'use strict';
({params, imports}) => {
  const programEncounter = params.entity;
  const formElement = params.formElement;
  const moment = imports.moment;
  const _ = imports.lodash;
  const ruleServiceLibrary = ruleServiceLibraryInterfaceForSharingModules;
  const rulesConfig = imports.rulesConfig;

  let visibility = true;
  let value = null;
  let answersToSkip = [];
  let validationErrors = [];

  // Visibility logic (standalone)
  const condition11 = new rulesConfig.RuleCondition({programEncounter, formElement})
    .when
    .valueInEncounter("54c718eb-0834-4deb-bc35-e26d546b0f83")
    .containsAnswerConceptName("04bb1773-c353-44a1-a68c-9b448e07ff70")
    .matches();

  visibility = condition11;

  // BMI calculation logic (independent)
  let heightObs = programEncounter.findObservation("Height");
  let weightObs = programEncounter.findObservation("Weight");

  let height = heightObs && heightObs.getValue();
  let weight = weightObs && weightObs.getValue();

  console.log('Height:', height);
  console.log('Weight:', weight);

  if (_.isFinite(weight) && _.isFinite(height)) {
    value = ruleServiceLibrary.common.calculateBMI(weight, height);
  }
console.log('BMI:', value);
  return new rulesConfig.FormElementStatus(formElement.uuid, visibility, value, answersToSkip, validationErrors);
};

